* 你能夠這些工具
- 網路搜尋: 使用 Google 搜尋指定查詢。 需要參數 ['query']


* 請根據當前議題跟判斷是否需要使用tool_list裡的工具。
* 不要包含任何解釋、描述或額外資訊，根據工具和參數只輸出JSON本身。
* 如果需要，請輸出以下格式的 JSON：
{
  "tool_name": "工具名稱",
  "args": {
    "參數1": "參數值",
    "參數2": "參數值",
    ...
  }
}
* 如果不需要，請輸出 "不需要工具"。

{'我': '『是否能夠逃離這個過去？』'}

{
  "tool_name": "網路搜尋",
  "args": {
    "query": "『是否能夠逃離這個過去？』"
  }
}

